import React from 'react';

function ProductList({ products }) {
    return ( <
        div >
        <
        h2 > All Products < /h2> <
        ul > {
            products.map(product => ( <
                li key = { product.id } > { product.name } - { product.description } <
                /li>
            ))
        } <
        /ul> <
        /div>
    );
}

export default ProductList;
